import React from 'react';

const Footer = () => {
  return (
    <div class='foot-wrapper '>
      <footer class='footer banner navbar-dark bg-dark text-light p-2'>
        <p className='footer_text'>Copyright: 2021 - Daniel Bradley <a href="https://github.com/WebDeverDan"><i class="devicon-github-original" ></i></a><a><i class="devicon-linkedin-plain" href="https://www.linkedin.com/in/daniel-bradley828/"></i></a></p>



      </footer>
    </div>

  );
};

export default Footer;
